    def create_db(self):
        conn = sqlite3.connect('productsEletroclub.db')
        cursor = conn.cursor()
        cursor.execute('''
            CREATE TABLE IF NOT EXISTS productsEletroclub (
                id TEXT PRIMARY KEY,
                name TEXT,
                url_key TEXT,
                price_discount REAL,
                price_promotional REAL,
                new_price REAL,
                condition TEXT,
                garantia TEXT
            )
        ''')
        cursor.execute('''
            CREATE TABLE IF NOT EXISTS price_history (
                id TEXT,
                name TEXT,
                price REAL,
                date TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                PRIMARY KEY (id)
            )
        ''')
        conn.commit()
        return conn
    

    def atualizar_preco(self, item_id, nome, preco_atual, link, preco_desc=None, condition=None, garantia=None, quantidade_disponivel=0):

        preco_atual = preco_atual or 0
        preco_desc = preco_desc or 0

        cursor = self.conn.cursor()
        cursor.execute("SELECT price_promotional, name FROM productsEletroclub WHERE id = ?", (item_id,))
        result = cursor.fetchone()

        if result:
            preco_antigo, nome_antigo = result
            preco_antigo = preco_antigo or 0
            mudancas = []
            if preco_atual != preco_antigo:
                mudancas.append(f"Preo: {float(preco_antigo):.2f} -> {float(preco_atual):.2f}")
            if nome != nome_antigo:
                mudancas.append(f"Nome: '{nome_antigo}' -> '{nome}'")

            if mudancas:
                cursor.execute('''
                    UPDATE productsEletroclub
                    SET price_promotional = ?, price_discount = ?, name = ?, condition = ?, garantia = ?
                    WHERE id = ?
                ''', (preco_atual, preco_desc, nome, condition, garantia, item_id))

                cursor.execute('''
                    INSERT OR REPLACE INTO price_history (id, name, price)
                    VALUES (?, ?, ?)
                ''', (item_id, nome, preco_atual))

                self.conn.commit()
                mudancas_str = ", ".join(mudancas)
                logging.info(f"Produto {nome} atualizado: {mudancas_str}")

            if preco_atual != preco_antigo:
                link_produto = f"https://www.eletroclub.com.br/checkout/cart/add?sku={item_id}&qty=1&seller=1&sc=5"
                link_produto2 = f"https://www.eletroclub.com.br{link}"
                desconto_percentual = calcular_desconto(preco_antigo, preco_atual)
                self.enviar_webhook_discord(nome, preco_antigo, preco_atual, link_produto, link_produto2, desconto_percentual)
            return True
        else:
            cursor.execute('''
                INSERT INTO productsEletroclub (id, name, url_key, price_discount, price_promotional, condition, garantia)
                VALUES (?, ?, ?, ?, ?, ?, ?)
            ''', (item_id, nome, link, preco_desc, preco_atual, condition, garantia))

            cursor.execute('''
                INSERT INTO price_history (id, name, price)
                VALUES (?, ?, ?)
            ''', (item_id, nome, preco_atual))

            self.conn.commit()
            logging.info(f"Novo produto adicionado: {nome} - Preo: {preco_atual:.2f}")

